import React from "react";
import Record from "./db.json";
const Home = () => {
    console.log(Record)
  return (
    <>
      <div className="container">

         {Record?.data?.datamap((value)=>
         {
            return <p key={value.time}>{value.time}</p>
         })}

      </div>
    </>
  );
};

export default Home;
